    <style>
        @import url('https://fonts.googleapis.com/css2?family=Poppins:wght@300&display=swap');
    
        .tech-work {
            display: flex;
            align-items: center;
            flex-direction: column;
            justify-content: center;
            width: 100vw;
            height: 100vh;
        }

        .tech-work__img {
            text-align: center;
        }

        .tech-work__img img {
            width: 65%;
        }

        .tech-work__titles {
            position: relative;
            bottom: 40px;
        }

        .tech-work__title {
            font-family: Poppins, Helvetica,"sans-serif";
            line-height: 180%;
            color: rgb(163, 163, 199);
            font-weight: 300;
            margin: 0;
            text-align: center;
            font-size: 22px;
        }

        @media screen and (max-width: 767px) {
            .tech-work {
                padding: 1rem;
                box-sizing: border-box;
            }

            .tech-work__title {
                font-size: 14px;
            }

            .tech-work__titles {
                position: relative;
                bottom: 0;
            }
        }
    </style>
